import React from "react";
import ReactDOM from "react-dom";

const fname = "parveen";
const lname = "narwal";
const datetoday = Date().toLocaleDateString();
ReactDOM.render(
  <>
    <h1> Rav33n {`my name is ${fname}  ${lname}`}</h1>
    <p> Current date is = {datetoday}</p>
    <ol>
      <li>Dark</li>
      <li>Mr roboto </li>
    </ol>
  </>,
  document.getElementById("root")
);
